import React, { Component } from 'react';

const CurrentDate = (props) => {
    return (
        <div>
            <p>The current date is: {props.date}</p>
        </div>
    );
};

class ForSalePage extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        knives: [
          {
            model: 'Jeff',
            forSale: true
          },
          {
            model: 'Alan',
            forSale: false
          },
          {
            model: 'Mary',
            forSale: true
          },
          {
            model: 'Jim',
            forSale: false
          },
          {
            model: 'Sara',
            forSale: true
          },
          {
            model: 'Laura',
            forSale: true
          }
        ]
      }
    }
    render() {
      const modelForSale = this.state.knives.filter(i => i.forSale == true); // change code here
      const renderOnline = modelForSale.map((i) => <li key={i.model + 1}>{i.model}</li>); // change code here
      return (
         <div className='dashboard'>
             <h1 className='loginPageTitle'>BladeX</h1>
                <h3 className='dashboardTitle'>For Sale</h3>
                <CurrentDate date={Date()} />
           <h1>Current Knives for Sale</h1>
           <ul>
             {renderOnline}
           </ul>
         </div>
      );
    }
  };

export default ForSalePage;
